import React from 'react';
import './Home.css';

import Nav from './Nav.js'
import About from './About';
import EndProgram from './ETE';
import Why from './Why';
import Speakers from './Speakers';



function Home() {
  return (
    <div className='head'>
      <Nav/>
      
      <About/>
      <EndProgram/>
      <Why/>    
      <header className='head2'>
    <h2><strong>Speakers</strong></h2>
    </header> 
      <div className='mains'>
        <div className='1'>
    < Speakers no="Keynote" name=" Ajay Prakash Sawhney " about="Secretary. Ministry of Electronics" about1="Government of India" img="" /></div>
    < Speakers no="Keynote" name=" Lt.General(Dr)Rajesh Pant(retd) " about="National Cyber security Coordinator" about1="National Security Council Secretariat of India" img="" />
    < Speakers no="Keynote" name=" Arundhati Bhattacharya " about="Chairperson and Cheif Executive Officer" about1="Salesforce India" img="" /> 
    < Speakers no="Speaker" name="Shri.Atanu Chakraborty " about="Chairman" about1="HDFC Bank" img="" /> 
    < Speakers no="Speaker" name="Joshua Brown" about="Vice President-Global Cheif Information Security Officer" about1="H&R Block" img="" /> 

    </div>

    </div>

    
      
    
      
  )

}

export default Home
